    render() {
        return (
            <ul className= "list-group my-5">
                <h3 className="text-capitalize text-center">
                    ToDo List
                </h3>
                <TodoItem></TodoItem>
                <button type="button" className="btn btn-danger btn-block text-capitalize mt-5">Clear</button>

            </ul>
        )
    }
}
